CREATE TABLE IF NOT EXISTS outdoors.camping(
   LAT                 NUMERIC(8,3) NOT NULL
  ,LONG                NUMERIC(6,3) NOT NULL
  ,CoordinatesCombined VARCHAR(17) NOT NULL
  ,CampName            VARCHAR(63) NOT NULL
  ,CampCode            VARCHAR(4)
  ,CampType            VARCHAR(28) NOT NULL
  ,State               VARCHAR(2) NOT NULL
  ,City                VARCHAR(31)
  ,Region              VARCHAR(9) NOT NULL
  ,Country             VARCHAR(3) NOT NULL
);
